import Link from 'next/link';

const Navbar = () => (
    <nav>
        <div className="navbarCenterDiv centerLayout">
            <a className="logo" href="/"><h2>ðŸŒ¼Florixa</h2></a>
            <ul>
                <li className="nav-item">
                    <Link href="/"><a className="nav-link"><h2>Home</h2></a></Link>
                </li>
                <li className="nav-item">
                    <Link href="/about"><a className="nav-link"><h2>About</h2></a></Link>
                </li>
            </ul>
        </div>



        <style jsx>{`
            .logo{
                font-weight: bold;
            }
            nav h2{
                margin: 0;
            }
            nav {
                background-color: #fbfbfb;
                /* background-color: darkseagreen; */
                padding:1em;
                
            }
            .navbarCenterDiv{
                display: flex;
                justify-content: space-between;
            }

            ul {
                display: flex;
                margin: 0;
                list-style: none;
                padding-inline-start: 0;
            }
            .nav-item {
                margin-left: 1em;
            }
               

            a {
                color: black;
                /* color: white; */
                text-decoration: none;
            }

            a:hover {
               text-decoration: underline; 
            }

        `}</style>
    </nav>
    /* 
        <nav className="navbar navbar-expand navbar-dark bg-dark mb-4">
